def longestPallindrome(string):

    #Check if string is empty
    if (len(string) == 0):
        return ""

    #Define a data structure and store the length of the longest pallindrome
    pallindromes = [[0 for x in range(len(string))] for y in range(len(string))]
    max_length = 0
