def caesar_encrypt(message, key):
    encrypted_message = ""
    for char in message:
        if char.isalpha():
            num = ord(char)
            num += key
            if char.isupper():
                if num > ord('Z'):
                    num -= 26
                elif num < ord('A'):
                    num += 26
            elif char.islower():
                if num > ord('z'):
                    num -= 26
                elif num < ord('a'):
                    num += 26
            encrypted_message += chr(num)
        else:
            encrypted_message += char
    return encrypted_message

